'use strict';

let error;
function lazyError() {
  return error ??= require('internal/errors').codes.ERR_INTERNAL_ASSERTION;
}

function assert(value, message) {
  if (!value) {
    const ERR_INTERNAL_ASSERTION = lazyError();
    throw new ERR_INTERNAL_ASSERTION(message);
  }
}

function fail(message) {
  const ERR_INTERNAL_ASSERTION = lazyError();
  throw new ERR_INTERNAL_ASSERTION(message);
}

assert.fail = fail;

module.exports = assert;

const cluster = require('cluster')

cluster.on('fork', () => {
  throw new Error('0x does not support clustering.')
})

'use strict'
const net = require('net')

let isWorker = false
try {
  // Skip redirecting stdout in Worker threads.
  isWorker = !require('worker_threads').isMainThread
} catch (e) {}

if (!isWorker) {
  const socket = new net.Socket({
    fd: 3,
    readable: false,
    writable: true
  })
  Object.defineProperty(process, 'stdout', {
    configurable: true,
    enumerable: true,
    get: () => socket
  })
  Object.defineProperty(process.stdout, 'fd', {
    value: socket._handle.fd
  })
}

import { createServer } from "node:http";
import Event from "node:events";

const myEvent = new Event();

function onData() {
    const items = [];
    setInterval(function myInterval() {
        items.push(Date.now());
    });
}

createServer(function handler(req, res) {
    myEvent.on("data", onData);

    myEvent.emit("data", Date.now());

    res.end("ok");

}).listen(3000, () => console.log("Server running at 3000"));

'use strict';

const {
  ReflectApply,
} = primordials;

class FreeList {
  constructor(name, max, ctor) {
    this.name = name;
    this.ctor = ctor;
    this.max = max;
    this.list = [];
  }

  alloc() {
    return this.list.length > 0 ?
      this.list.pop() :
      ReflectApply(this.ctor, this, arguments);
  }

  free(obj) {
    if (this.list.length < this.max) {
      this.list.push(obj);
      return true;
    }
    return false;
  }
}

module.exports = FreeList;
